// src/utils/ActiveModule.js
import React from 'react';
import DashBoard from '../components/modules/Dashboard';
import EquipmentPage from '../components/modules/EquipmentPage';
import TicketsPage from '../components/modules/TicketsPage';

// Fonction de rendu conditionnel des modules
export const renderModule = (activeModule) => {
  switch (activeModule) {
    case 'dashBoard':
      return <Dashboard />;
    case 'equipmentPage':
      return <EquipmentPage />;
    case 'ticketsPage':
      return <TicketsPage />;
    default:
      return <Dashboard />;
  }
};
